import ResultsStore from "./Results.store.ts";

describe('Results', () => {
    const testingResults = [
        {
            "src": "blob:http://localhost:5173/de306d6d-1f1c-43da-aec7-e08c9593fe2a",
            "text": "https://github.com/MARSHAL327",
            "id": 1
        },
        {
            "text": "https://www.ruletech.com.au",
            "src": "data:image/png;base64,",
            "id": 2
        }
    ]

    beforeEach(() => {
        ResultsStore.results = []
    })

    test('Обратный массив', () => {
        ResultsStore.results = testingResults
        expect(ResultsStore.reverseResults).toEqual([
            {
                "text": "https://www.ruletech.com.au",
                "src": "data:image/png;base64,",
                "id": 2
            },
            {
                "src": "blob:http://localhost:5173/de306d6d-1f1c-43da-aec7-e08c9593fe2a",
                "text": "https://github.com/MARSHAL327",
                "id": 1
            }
        ]);
    })

    test('Обратный массив если исходный пустой', () => {
        ResultsStore.results = []
        expect(ResultsStore.reverseResults).toEqual([]);
    })

    test('Добавление элемента в массив', () => {
        ResultsStore.addResult(testingResults[1])

        expect(ResultsStore.results).toEqual([
            {
                "text": "https://www.ruletech.com.au",
                "src": "data:image/png;base64,",
                "id": 1
            },
        ]);
    })

    test('Добавление нескольких элементов в массив', () => {
        ResultsStore.addResult(testingResults[0])
        ResultsStore.addResult(testingResults[1])

        expect(ResultsStore.results).toEqual(testingResults);
    })

    test('Добавление с отрицательным id', () => {
        ResultsStore.addResult({
            ...testingResults[0],
            id: -10
        })

        expect(ResultsStore.results).toEqual([
            {
                "src": "blob:http://localhost:5173/de306d6d-1f1c-43da-aec7-e08c9593fe2a",
                "text": "https://github.com/MARSHAL327",
                "id": 1
            }
        ]);
    })
})